import React from 'react'

import './SideDrawer.css'

const sideDrawer = props => {
    return (
        <nav className='side-drawer'>
            <ul>
                <li><a href="/">About Me</a></li>
                <li><a href="/">Skills</a></li>
                <li><a href="/">Games</a></li>
            </ul>
        </nav>
    );
};

export default sideDrawer;

